            "shortDescription": "@SupeRails creator and Rails mentor Yaroslav Shmarov shares how some of the most common frontend problems can be solved with Hotwire.\n\nHe covers:\n- Pagination, search and filtering, modals, live updates, dynamic forms, inline editing, drag & drop, live previews, lazy loading & more\n- How to achieve more by combining tools (Frames + Streams, StimulusJS, RequestJS, Kredis & more)\n- What are the limits of Hotwire?\n- How to write readable and maintainable Hotwire code\n- Bad practices\n\nSlides available at: https://www.icloud.com/keynote/031WsmVqF1yJVtjl2riyTgw_A#RailsWorld_2023_Hotwire_Cookbook_Yaroslav_Shmarov\n\nLinks:\nhttps://rubyonrails.org/\nhttps://superails.com/\nhttps://hotwired.dev/\n\n#RailsWorld #RubyonRails #rails #hotwire #stimulusjs #turbo #turbolinks #domid #kredis #turboframes #turbostreams\n\nThank you Dell APEX for sponsoring the editing and post-production of these videos.Visit them at: https://dell.com/APEX",
